import igmg_logo from './assets/igmg_logo.png'
import TabButton from './components/TabButtton';

export function MenuBar() {
    return (
        <Flex className="MenuBar" width={'full'}>
            <img src={igmg_logo} className="App-logo" alt="logo" />
            <TabButton>
                Home
            </TabButton>
            <TabButton>
                About
            </TabButton>
        </Flex>
    );
}
